using Models;
using System;
using System.Collections.Generic;
using System.Text;

namespace Services
{
    class CategoryService
    {
        private IEnumerable<Category>? _categories;
        public async ValueTask<IEnumerable<Category>> GetCategoriesAsync()
        {
            if (_categories is null)
            {

            var categories = new List<Category>();

            var fruits = new List<Category>
            {
                new (1, "Fruits", 0, "fruits.png", "Photo <a href=https://www.fastandup.in/nutrition-world/wp-content/uploads/2023/06/fruit-min.png "),
                new (2, "Seasonal Fruits", 1, "seasonal_fruits.jpg", "Photo <a href=https://constantinosmarket.com/wp-content/uploads/2017/12/jakub-kapusnak-296131.jpg"),
                new (3, "Exotic Fruits", 1, "exotic_fruits.jpg", "Photo <a href=https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR8y-SMfr7n-4zTKAaWaYJeytNCmdSTwF10OA&s")
            };
            categories.AddRange(fruits);

            var vegetables = new List<Category>
            {
                new (4, "Vegetables", 0, "vegetables.png", "Photo <a href=https://mp-engineering.co.uk/wp-content/uploads/2024/03/vegetable-diet-1024x768.png"),
                new (5, "Green Vegetables", 4, "green_vegetables.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (6, "Leafy Vegetables", 4, "leafy_vegetables.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (7, "Salads", 4, "salads.jpg", "Photo <a href=data:image/jpeg;base64,")
            };
            categories.AddRange(vegetables);

            var dairy = new List<Category>
            {
                new (8, "Dairy", 0, "dairy.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (9, "Milk, Curd & Yogurts", 8,"milk_curd_yogurts.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (10, "Butter & Cheese", 8,"butter_cheese.jpg", "Photo <a href=data:image/jpeg;base64,")
            };
            categories.AddRange (dairy);

            var eggsMeat = new List<Category>
            {
                new (11, "Eggs & Meat", 0, "eggs_meat.jpg", "Photo <a href=https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSvOzidVkz-exy4dc0j1sWOl9a397NToB6q6Q&s"),
                new (12, "Eggs", 11, "eggs.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (13, "Meat", 11, "meat.jpg", "Photo <a href=data:image/jpeg;base64,"),
                new (14, "Seafood", 11, "seafood.jpg", "Photo <a href=data:image/jpeg;base64,")
            };
            categories.AddRange(eggsMeat);
            _categories = categories; 
          }
            return _categories;
        }

        public async ValueTask<IEnumerable<Category>> GetMainCategoriesAsync () =>
            (await GetCategoriesAsync())
            .Where(c=> c.ParentId == 0);
    }
}
